import React from 'react'
import './shimmer.css'
const Shimmer = () => {
    return (
        <div className="restaurant-list">
          <h1><i class="fas fa-truck-loading    "></i></h1>
          {Array(10)
            .fill("")
            .map((e, index) => (
              <div key={index} className="shimmer-card"></div>
            ))}
        </div>
      );
    };

export default Shimmer
